import React from "react";
import { Link } from "react-router-dom";
import logo from './logo.png';
import { APIProvider, Map } from '@vis.gl/react-google-maps';

const Hide = () => {
    const column1 = document.getElementById("column_one");
    const column2 = document.getElementById("column_two");
    const btn = document.getElementById("HideBtn");
    if (btn.innerHTML === "Hide Blocks") {
        column1.style.display = 'none';
        column2.style.width = '100%';
        btn.innerHTML = "Show Blocks";
    } else if (btn.innerHTML === "Show Blocks") {
        column1.style.display = 'inline';
        column2.style.width = '80%';
        btn.innerHTML = "Hide Blocks";
    }
};

const Reservations = () => {
    const position = { lat: 6.8214925581511565, lng: 80.04122509763354 };

    return (
        <APIProvider apiKey={"YOUR_GOOGLE_MAPS_API_KEY"}>
            <>
                <nav>
                    <div className="logo">
                        <img src={logo} alt="Logo" width="100" height="100" />
                    </div>
                    <Link to="/Home" title="Home"><b>Home</b></Link>
                    <Link to="/Dashboard" title="Dashboard"><b>Dashboard</b></Link>
                    <Link to="/Profile" title="Profile"><b>Profile</b></Link>
                    <Link to="/Reservations" title="Reservations"><b>Reservations</b></Link>
                    <Link to="/Profile" title="Profile" style={{ marginRight: '-10px' }}><b>Sign Out</b></Link>
                </nav>

                <article className="cf">
                    <div className="fl w-20 bg-navy vh-100 tc" id="column_one">
                        <div>
                            <Link className="link f6 f3-ns fw6 tc mt4 db white no-underline underline-hover" to="/Dashboard" title="Dashboard">Dashboard</Link>
                            <Link className="link f6 f3-ns fw6 tc mt4 db white no-underline underline-hover" to="/Profile" title="Profile">Profile</Link>
                            <Link className="link f6 f3-ns fw6 tc mt4 db white no-underline underline-hover" to="/Reservations" title="Reservations">Reservations</Link>
                            <a className="f6 f3-ns fw6 tc mt4 db white no-underline underline-hover" href="#0">Log Out</a>
                        </div>
                    </div>
                    <div className="fl w-80 bg-light-gray vh-100" id="column_two">
                        <div>
                            <button className="f6 br2 ph3 pv2 mb2 dib black bg-light-gray" id="HideBtn" onClick={Hide}>Hide Blocks</button>
                            <section style={{ marginTop: '110px' }}>
                                <div className="tc">
                                    <h1 className="ma0 tc">Welcome Back To</h1>
                                    <h2 className="f8 fw4 gray mt1"><b>NSBM Student Accommodation Rental Service</b></h2>
                                    <div className="m-100 vh-50" style={{ marginTop: '3.5%', height: '500px' }}>
                                        <Map defaultCenter={position} defaultZoom={10.4}></Map>
                                    </div>
                                </div>
                            </section>
                        </div>
                    </div>
                </article>

                <footer className="bottom-0 w-100 ph3 ph5-m ph6-l bg-light-gray z-9999">
                    <small className="f6 db tc">©<b className="ttu">Created by Group CC</b>., All Rights Reserved</small>
                </footer>
            </>
        </APIProvider>
    );
}

export default Reservations;
